import React from 'react';
import note from '../../assets/cover/note.png';
imp

function Portfolio() {
  return (

    <>

      <div>
        <a href='https://github.com/salvo-t/Note-Taker'>text</a>
        <img src={note} alt=''></img>
        <p>This is my note taker app made deployed with heroku</p>
      </div>

      <div>
        <a href='https://github.com/salvo-t/Text-editor'>text</a>
        <img src={require('../../assets/cover/jate.png')} alt=''></img>
        <p>This is my text editor made with PWA</p>
      </div>

      <div>
        <a href='https://github.com/salvo-t/E-commerce-back-end'>text</a>
        <img src={require('../../assets/cover/backend.png')} alt=''></img>
        <p>This is my ecommerce backened using insomnia</p>
      </div>

    </>

  )
};

export default Portfolio;
